import cv2
import base64
import np


def _tran_canny(image):
    image = cv2.GaussianBlur(image, (3, 3), 0)
    return cv2.Canny(image, 50, 150)


def detect_displacement(img_slider, img_background, canvas_width):
    try:
        image = base64_to_image(img_slider)
        template = base64_to_image(img_background)
        res = cv2.matchTemplate(_tran_canny(
            image), _tran_canny(template), cv2.TM_CCOEFF_NORMED)
        min_val, max_val, min_loc, max_loc = cv2.minMaxLoc(res)
        w = template.shape[1]
        return {'code': 200, 'msg': max_loc[0]*canvas_width/w}
    except Exception as e:
        return {'code': 500, 'msg': str(e)}


def base64_to_image(base64_code):
    img_data = base64.b64decode(base64_code)
    img_array = np.frombuffer(img_data, np.uint8)
    img = cv2.imdecode(img_array, cv2.COLOR_RGB2BGR)
    return img


if __name__ == '__main__':
    top_left = detect_displacement(
        "",
        "",
        280)
    print(top_left)
